import React from 'react';
import '../css/Header.css';

const Header = props => {

  if (props.imageOfTheDay) {
    const styles = {
      headerHero: {
        backgroundImage: `url(${props.imageOfTheDay.url}`,
      }
    }
  }

  return (
    <header className="App-header">
      <div className="header-hero" style={styles.headerHero}>
        <div className="header-hero--text">
          <span>NASA Images</span>
        </div>
      </div>
    </header>
  );
}



export default Header;
